的——天下有警\n72.5万 2\'2\"\n\n特朗普常推特怼人，是不是战略性欺骗？特朗普的推特没输过谁\n59万 2\'2\"\n\n大咖的腔调丨属狗的特朗普，却有一颗公鸡心\n36.2万 2\'20\"\n\n美国共和党正式提名特朗普为2020总统候选人\n10万 32\"\n唐纳德·特朗普\n特色词条 | 本词条按照特色词条指南编辑并维护\n贡献维护者 Eminem丶路飞 \n唐纳德·特朗普（Donald Trump，1946年6月14日- ），出生于美国纽约，德裔美国共和党籍政治家、企业家、房地产商人、电视人[1]，第45任美国总统。\n\n特朗普于1968年获得宾夕法尼亚大学沃顿商学院经济学学士学位，随后任职于父亲弗雷德·特朗普的房地产公司。1971年接管公司，从事房地产开发，投资范围逐步延伸至其他多个行业。特朗普于2015年6月以美国共和党人身份宣布参选美国总统，2016年11月9日当选美国第45任总统，2017年1月20日宣誓就职。2019年9月24日，美国国会众议院启动针对特朗普的弹劾调查，12月18日经过全体投票通过两项弹劾条款。2020年2月5日，美国国会参议院否决了两项弹劾条款，弹劾失败[2][3]。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/eaaeec3fb0daa170a90b4387344fb41d.png','',0),(1056,471,'%u514B%u6797%u987F%B7%u5E0C%u62C9%u91CC','希拉里·黛安·罗德姆·克林顿（Hillary Diane Rodham Clinton，1947年10月26日-），美国律师、民主党籍政治家，第67任美国国务卿，纽约州前联邦参议员，美国前第一夫人。\n\n2000年，希拉里在纽约州联邦参议员选举中胜出，成为该州历史上第一位女性联邦参议员，更成为历史上第一位拥有公职的第一夫人，并在6年任期满后以大幅度的领先优势获得连任。希拉里·克林顿是一位富有争议的政治人物，当第一夫人期间曾主持一系列改革。\n\n希拉里在2008年美国总统选举中，首度参与美国民主党总统初选。虽然希拉里领先对手伊利诺伊州联邦参议员贝拉克·奥巴马27万张民选得票，但最终在超级代表制度票数败给对手。虽然她并非首位参与联邦总统大选的女候选人，但却被普遍认为是历史上第一位的确很有可能当选的。最后奥巴马成功当选后，提名她出任国务卿，并最终成为美国历史上的第3位女国务卿，成为2011年和2013年美国最受欢迎的政治人物。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/619e5935c5cf97a114cf01069b37e7bc.png','',0),(1057,471,'%u8D1D%u62C9%u514B%B7%u4FAF%u8D5B%u56E0%B7%u5965%u5DF4%u9A6C','贝拉克·侯赛因·奥巴马，1961年8月4日生，美国民主党籍政治家，第44任美国总统，美国历史上第一位非裔美国人总统。\n\n1991年奥巴马以优等生身份从哈佛法学院毕业，而后在芝加哥大学法学院教授宪法长达12年（1992-2004年）。2007年2月10日宣布参加2008年美国总统选举。2008年11月4日当选为美国总统。2009年10月9日获诺贝尔和平奖。2012年击败共和党候选人罗姆尼，成功连任美国总统。2017年1月20日正式卸任美国总统','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/f80f27b1f6bac65f5ed9b58cd298d76e.png','',0),(1058,471,'%u54C8%u91CC%B7S%B7%u675C%u9C81%u95E8','哈里·S·杜鲁门（英文：Harry S. Truman，1884年5月8日－1972年12月26日），其姓氏早年在中国被译作“褚盟”[1]，美国民主党政治家。\n\n1918年，第一次世界大战期间，杜鲁门在法国带领一支炮兵部队[2]。1922年，当选为密苏里州杰克逊县法院的法官[3]。1935至1944年任联邦参议员[3]。1945年，担任第34任美国副总统[4]。1945年4月至1953年担任第33任美国总统[4]。1953年卸任回乡[5]。1972年12月26日，杜鲁门在堪萨斯城病故，享年88岁','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/28d49774e1c031cb4cbb22f097f92467.png','',0),(1059,472,'%u5510%u7EB3%u5FB7%B7%u5DDD%u666E','\n \n\n目录\n \n\n神奇的特朗普，既是俄罗斯民族的后裔，还和希拉里有血缘关系！\n324.6万 3\'12\"\n\n为什么有人说特朗普的老婆是租来的——天下有警\n72.5万 2\'2\"\n\n特朗普常推特怼人，是不是战略性欺骗？特朗普的推特没输过谁\n59万 2\'2\"\n\n大咖的腔调丨属狗的特朗普，却有一颗公鸡心\n36.2万 2\'20\"\n\n美国共和党正式提名特朗普为2020总统候选人\n10万 32\"\n唐纳德·特朗普\n特色词条 | 本词条按照特色词条指南编辑并维护\n贡献维护者 Eminem丶路飞 \n唐纳德·特朗普（Donald Trump，1946年6月14日- ），出生于美国纽约，德裔美国共和党籍政治家、企业家、房地产商人、电视人[1]，第45任美国总统。\n\n特朗普于1968年获得宾夕法尼亚大学沃顿商学院经济学学士学位，随后任职于父亲弗雷德·特朗普的房地产公司。1971年接管公司，从事房地产开发，投资范围逐步延伸至其他多个行业。特朗普于2015年6月以美国共和党人身份宣布参选美国总统，2016年11月9日当选美国第45任总统，2017年1月20日宣誓就职。2019年9月24日，美国国会众议院启动针对特朗普的弹劾调查，12月18日经过全体投票通过两项弹劾条款。2020年2月5日，美国国会参议院否决了两项弹劾条款，弹劾失败[2][3]。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/eaaeec3fb0daa170a90b4387344fb41d.png','',0),(1060,472,'%u514B%u6797%u987F%B7%u5E0C%u62C9%u91CC','希拉里·黛安·罗德姆·克林顿（Hillary Diane Rodham Clinton，1947年10月26日-），美国律师、民主党籍政治家，第67任美国国务卿，纽约州前联邦参议员，美国前第一夫人。\n\n2000年，希拉里在纽约州联邦参议员选举中胜出，成为该州历史上第一位女性联邦参议员，更成为历史上第一位拥有公职的第一夫人，并在6年任期满后以大幅度的领先优势获得连任。希拉里·克林顿是一位富有争议的政治人物，当第一夫人期间曾主持一系列改革。\n\n希拉里在2008年美国总统选举中，首度参与美国民主党总统初选。虽然希拉里领先对手伊利诺伊州联邦参议员贝拉克·奥巴马27万张民选得票，但最终在超级代表制度票数败给对手。虽然她并非首位参与联邦总统大选的女候选人，但却被普遍认为是历史上第一位的确很有可能当选的。最后奥巴马成功当选后，提名她出任国务卿，并最终成为美国历史上的第3位女国务卿，成为2011年和2013年美国最受欢迎的政治人物。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/619e5935c5cf97a114cf01069b37e7bc.png','',0),(1061,472,'%u8D1D%u62C9%u514B%B7%u4FAF%u8D5B%u56E0%B7%u5965%u5DF4%u9A6C','贝拉克·侯赛因·奥巴马，1961年8月4日生，美国民主党籍政治家，第44任美国总统，美国历史上第一位非裔美国人总统。\n\n1991年奥巴马以优等生身份从哈佛法学院毕业，而后在芝加哥大学法学院教授宪法长达12年（1992-2004年）。2007年2月10日宣布参加2008年美国总统选举。2008年11月4日当选为美国总统。2009年10月9日获诺贝尔和平奖。2012年击败共和党候选人罗姆尼，成功连任美国总统。2017年1月20日正式卸任美国总统','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/f80f27b1f6bac65f5ed9b58cd298d76e.png','',0),(1062,472,'%u54C8%u91CC%B7S%B7%u675C%u9C81%u95E8','哈里·S·杜鲁门（英文：Harry S. Truman，1884年5月8日－1972年12月26日），其姓氏早年在中国被译作“褚盟”[1]，美国民主党政治家。\n\n1918年，第一次世界大战期间，杜鲁门在法国带领一支炮兵部队[2]。1922年，当选为密苏里州杰克逊县法院的法官[3]。1935至1944年任联邦参议员[3]。1