里·S·杜鲁门（英文：Harry S. Truman，1884年5月8日－1972年12月26日），其姓氏早年在中国被译作“褚盟”[1]，美国民主党政治家。\n\n1918年，第一次世界大战期间，杜鲁门在法国带领一支炮兵部队[2]。1922年，当选为密苏里州杰克逊县法院的法官[3]。1935至1944年任联邦参议员[3]。1945年，担任第34任美国副总统[4]。1945年4月至1953年担任第33任美国总统[4]。1953年卸任回乡[5]。1972年12月26日，杜鲁门在堪萨斯城病故，享年88岁','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/28d49774e1c031cb4cbb22f097f92467.png','',0),(1067,474,'vvv','','','',0),(1068,474,'vvvbbb','','','',0),(1069,475,'%u4E5D%u5BE8%u6C9F','\n \n\n目录\n \n九寨沟国家级自然保护区\n四川  世界自然遗产,国家AAAAA级旅游景区\n    \n15 ~ 9 ℃\n小雨\n明 17 ~ 7℃\n后 18 ~ 8℃\n特色词条 | 本词条按照特色词条指南编辑并维护\n贡献维护者 庄龄 \n九寨沟：世界自然遗产、国家重点风景名胜区、国家AAAAA级旅游景区、国家级自然保护区、国家地质公园、世界生物圈保护区网络，是中国第一个以保护自然风景为主要目的的自然保护区。\n\n九寨沟位于四川省阿坝藏族羌族自治州九寨沟县境内。地处青藏高原、川西高原、山地向四川盆地过渡地带，南距成都市300多公里，是一条纵深50余千米的山沟谷地，总面积64297公顷，森林覆盖率超过80%。因沟内有树正寨、荷叶寨、则查洼寨等九个藏族村寨坐落在这片高山湖泊群中而得名。\n\n九寨沟国家级自然保护区主要保护对象是以大熊猫、金丝猴等珍稀动物及其自然生态环境。有74种国家保护珍稀植物，有18种国家保护动物，还有丰富的古生物化石、古冰川地貌。\n\n“九寨归来不看水”，是对九寨沟景色真实的诠释。泉、瀑、河、滩108个海子，构成一个个五彩斑斓的瑶池玉盆。长海、剑岩、诺日朗、树正、扎如、黑海六大景观，呈“Y”字形分布。翠海、叠瀑、彩林、雪峰、藏情、蓝冰，被称为“六绝”。神奇的九寨，被世人誉为“童话世界”，号称“水景之王”。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/a925e23fbfbd6d91badf8841a275eaa9.png','',0),(1070,475,'%u7A3B%u57CE%u4E9A%u4E01','\n \n\n目录\n \n四川亚丁国家级自然保护区\n    \n同义词\n稻城亚丁一般指四川亚丁国家级自然保护区\n多义项\n省级风景名胜区 更多义项 \n特色词条 | 本词条按照特色词条指南编辑并维护\n贡献维护者 mockJkore \n四川亚丁国家级自然保护区，位于四川省甘孜藏族自治州南部稻城县香格里拉镇，地处青藏高原东部，横断山脉中段，南部与云南省香格里拉毗邻，东南连泸沽湖和丽江。地理坐标为东经99度58分-100度28分，北纬28度11分-28度34分，总面积1457.5平方千米，截至2016年10月已开发面积为32.44平方千米[1][2][3][4]。\n\n四川亚丁国家级自然保护区森林面积560平方千米，有维管束植物1126种、脊椎动物291种。海拔在5000米以上的山峰10余座，海拔4500米以上的山峰30余座，高山古冰川湖泊62个[4]。\n\n2001年6月，成为国家级自然保护区[5]；2003年7月10日，被列入联合国MAB保护计划[5]。\n\n因疫情原因，景区预计2020年3月10日重新开放。[6]\n\n','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d8096b58c14f817fe5b3976334eead1d.png','',0),(1071,475,'%u9752%u6D77%u6E56','青海湖，藏语名为“措温布”（意为“青色的海”）。位于青藏高原东北部、青海省境内，中国最大的内陆湖。由祁连山脉的大通山、日月山与青海南山之间的断层陷落形成。[1]\n\n2012年7月30日，青海省气象科学研究所最新的遥感监测结果显示，青海湖面积持续8年增大。\n\n2014年10月20日9时50分，青海湖海心山北侧出现“龙吸水”壮观场景。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/a0d5f2e80e0b47ad14c1eda2b724e8b4.png','',0),(1072,475,'%u7389%u9F99%u96EA%u5C71','玉龙雪山为云南省丽江市境内雪山群，东界丽（江）鸣（音）公路，西临虎跳峡涧、南起玉湖，北至大具下虎跳峡口，地处东经100°4′2″-100°16′30″、北纬27°3′2″～27°18′57″之间，在丽江北面约15千米处，全长75千米，是北半球最近赤道终年积雪的山脉，隔江西与中甸雪山、东与绵绵山相并列，北自三江口，向南延伸到北纬27°，如扇面向古城展开。全山的13座山峰由南向北纵向排列，主峰扇子陡最高处海拔5596米，终年积雪，雪线高度介于4800～5000米之间。发育有亚欧大陆距离赤道最近的温带海洋性冰川。[1]\n\n玉龙雪山在纳西语中被称为“欧鲁”，意为“天山”。其十三座雪峰连绵不绝，宛若一条“巨龙”腾越飞舞，故称为“玉龙”。又因其岩性主要为石灰岩与玄武岩，黑白分明，所以又称为“黑白雪山”。是纳西人的神山，传说纳西族保护神“三朵”的化身。[2]\n\n1984年，云南玉龙雪山省级自然保护区建立。2001年，玉龙雪山被评为4A级旅游景区，2007年5月成为全国首批5A级旅游景区。[2]','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/1a5c2289485cf1dbf68461a88d08f6cb.png','',0),(1073,476,'张学政','打到你哭','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1074,476,'韩梦','对面退游戏','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1075,476,'曹可磊','见人就秒','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1076,476,'刘哲','爹妈白养','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1077,477,'cccc','','','',0),(1078,477,'vvv','','','',0),(1079,478,'张学政','打到你哭','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1080,478,'韩梦','对面退游戏','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1081,478,'曹可磊','见人就秒','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1082,478,'刘哲','爹妈白养','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1083,479,'张学政','打到你哭','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',2),(1084,479,'韩梦','对面退游戏','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1085,479,'曹可磊','见人就秒','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1086,479,'刘哲','爹妈白养','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/d6261af50a1ad366321ee5bac9485664.png','',0),(1087,480,'%u7EBD%u7EA6','纽约市（New York City，简称NYC），位于美国纽约州东南部大西洋沿岸，是美国第一大城市及第一大港口，纽约都市圈为世界上最大的城市圈之一，与英国伦敦、中国香港并称为“纽伦港”（Nylonkong）。[1][2][3]纽约与伦敦并列为全世界最顶级的国际大都市。2018年11月，纽约被GaWC评为Alpha++级世界一线城市。[4]\n\n截至2017年，纽约市总面积达1214.4平方公里，人口约862万人[5]，居住在789平方公里的土地上。2018年，纽约地区生产总值已达到8017亿美元。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/39b269e95030ef162e1cd8b6057de6f5.png','',0),(1088,480,'%u4F26%u6566','伦敦(London)，是大不列颠及北爱尔兰联合王国首都，世界第一大金融中心，与纽约和香港并称为“纽伦港”。[1]伦敦是英国的政治、经济、文化、金融中心，是全世界博物馆、图书馆和体育馆数量最多的城市。有19家世界500强总部和7座世界排名前100的大学位于伦敦。伦敦的伦敦大学学院世界排名第8、帝国理工大学世界排名第9、伦敦政治经济学院世界排名第27、伦敦国王学院世界排名第33。[2]2018年伦敦地区生产总值已达到6532亿美元。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/5d945d2b03f248c8ec03613ee7333b57.png','',0),(1089,480,'%u591A%u4F26%u591A','多伦多（Toronto），位于加拿大安大略湖的西北沿岸，是加拿大最大的城市、安大略省的省会，也是加拿大的政治、经济、文化和交通中心，世界著名的国际大都市。[1]\n\n多伦多坐落在安大略湖西北岸的南安大略地区，东南邻纽约，东北邻渥太华，面积为7125平方千米。市区里有半数的居民是来自全球各国共100多个民族的移民，多元的族裔特色，使得这里汇集了世界上140多种语言，成为全世界最多元化的城市之一。2016年，多伦多市人口已达到592.8万。多伦多下属五个区，分别是西多伦多、约克区、东多伦多、北多伦多和密西沙加。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/8333aa6bf51af52fcfe4749e6e1c281f.png','',0),(1090,480,'%u582A%u57F9%u62C9','堪培拉（Canberra），是澳大利亚联邦的首都，位于澳大利亚东南部山脉区的开阔谷地上。东经149°07′，南纬35°17′，面积2395平方公里，人口41.03万，海拔760米。莫朗格洛河横贯市区，西流入马兰比吉河。原为牧羊地，1913年按规划始建，1927年联邦政府从墨尔本迁此。全国政治中心，以银行、饭店和公共服务业为主要经济部门，有铁路连接各大城市，有澳大利亚国立大学、堪培拉大学、澳大利亚国家图书馆等教育机构。市区西南有宇宙航行跟踪站。旅游业甚盛。气候温和，四季分明，全年降雨量平均，四季都有阳光普照的日子。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/94f149225f50162558d39d01a946d0cd.png','',0),(1091,481,'1','11','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/a71d10262973d5ce4f5205b875b02095.png','',0),(1092,481,'2','22','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/c149d26a12dec26ab795022be9a7dec2.png','',0),(1093,482,'1','11','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/a71d10262973d5ce4f5205b875b02095.png','',1),(1094,482,'2','22','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/c149d26a12dec26ab795022be9a7dec2.png','',0),(1095,483,'1','11','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/a71d10262973d5ce4f5205b875b02095.png','',0),(1096,483,'2','22','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/c149d26a12dec26ab795022be9a7dec2.png','',0),(1097,484,'%u5E72%u561B','莫柔上午/++','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/7f61f43050123c64470842d15aaae298.png','',0),(1098,484,'%u6708%u6709%u9634%u6674%u5706%u7F3A','啦咯怕咯是1613','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/6e523ef29ced7b422eb3f6450148da7d.png','',1),(1099,485,'%u5E72%u561B','莫柔上午/++','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/7f61f43050123c64470842d15aaae298.png','',0),(1100,485,'%u6708%u6709%u9634%u6674%u5706%u7F3A','啦咯怕咯是1613','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/6e523ef29ced7b422eb3f6450148da7d.png','',0),(1101,486,'%u6C64%u552F','汤唯，1979年10月7日出生于浙江省杭州市，祖籍浙江温州乐清，华语影视女演员，毕业于中央戏剧学院导演系本科班。\n2004年，主演了个人首部电影作品《警花燕子》，并凭借该片获得第6届电影频道数字电影百合奖优秀女演员奖[1]。2007年，因出演剧情片《色·戒》中王佳芝一角获得更多关注，并凭该片夺得第44届台湾电影金马奖最佳新人奖[2]。2010年，凭借爱情片《月满轩尼诗》获得第11届华语电影传媒大奖最佳女主角奖[3]。\n2011年，凭借文艺片《晚秋》获得韩国百想艺术大赏、韩国影评奖、釜山影评家奖等十余个最佳女主角奖项[4][5][6]。2013年，主演的爱情片《北京遇上西雅图》创造了华语爱情片票房纪录[6]，凭借该片获得上海影评人奖最佳女主角、中国电影导演协会年度女演员、北京大学生电影节最佳女演员等多个奖项[7]。2014年，在文艺爱情片《黄金时代》中饰演萧红[8]。2015年，主演动作片《骇客交锋》[9]。2016年，其主演的爱情片《北京遇上西雅图之不二情书》取得了7.9亿元的票房成绩，再次创造了华语爱情片票房纪录[10][11]。2019年，主演古装剧《大明风华》，饰演女主角孙若微[12]。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/9a67d9385953613802c79251cef5b7be.png','',4),(1102,486,'%u5218%u4EA6%u83F2','刘亦菲，1987年8月25日出生于湖北省武汉市，华语影视女演员、歌手，毕业于北京电影学院2002级表演系本科。\n2002年，因出演电视剧《金粉世家》中白秀珠一角踏入演艺圈[1]。2003年因主演武侠剧《天龙八部》崭露头角[2]。2004年凭借仙侠剧《仙剑奇侠传》赵灵儿一角获得了高人气与关注度[3]。2005年因在武侠剧《神雕侠侣》中饰演小龙女受到广泛关注[4][5]。2006年发行首张国语专辑《刘亦菲》和日语专辑《All My Words》[6][7]；同年，成为金鹰节历史上首位金鹰女神[8]。2008年起转战大银幕，并凭借好莱坞电影《功夫之王》成为首位荣登IMDB电影新人排行榜榜首的亚洲女星[9]。2009年在“80后新生代娱乐大明星”评选活动中获封“四小花旦”之一[10]。2012年，获得第24届香港专业电影摄影师学会最具魅力女演员奖[11]。\n2014年，凭借出演古装片《铜雀台》中灵雎一角获得第5届澳门国际电影节最佳女主角奖[12]。2015年，刘亦菲主演的电影《夜孔雀》、《烽火芳菲》均入围国际A类电影节主竞赛单元[13][14]。2016年，凭借出演爱情片《第三种爱情》中邹雨一角获得第16届华语电影传媒大奖最受瞩目女演员奖[15]。2017年，主演迪士尼真人版电影《花木兰》[16]，并入选《好莱坞报道者》评选的“好莱坞新星”[17]；同年，凭借奇幻片《二代妖精之今生有幸》中白纤楚一角获得颇高关注[18]。2018年，主演电视剧《南烟斋笔录》饰演陆曼笙和夜摩罗。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/00dfd72323cd1c1b455071dda9466253.png','',1),(1103,486,'%u8303%u51B0%u51B0','范冰冰，1981年9月16日出生于山东青岛，华语影视女演员、制片人、歌手，毕业于上海师范大学谢晋影视艺术学院。\n1996年出演电视剧《女强人》，1998年主演电视剧《还珠格格》获得广泛关注，2002年主演电影《一见钟情》涉足影坛[1]。2004年凭借冯小刚执导的电影《手机》获得第27届大众电影百花奖最佳女主角。2005年发行首张个人专辑《刚刚开始》。2007年凭借电影《心中有鬼》获得第44届台湾电影金马奖最佳女配角；[2]同年主演的电影《苹果》入围第57届柏林国际电影节主竞赛单元，获得第4届欧亚国际电影节最佳女演员。[3]2010年主演李玉执导的电影《观音山》获得第23届东京国际电影节最佳女演员，该片亦获东京国际电影节最佳艺术贡献奖。[4][5]2011年担任第24届东京国际电影节评委。\n2013年获好莱坞报道年度最佳国际艺人奖，[6]2013-2017年连续五年蝉联福布斯中国名人榜榜首。[7]2016年主演电影《我不是潘金莲》获得第64届圣塞巴斯蒂安国际电影节最佳女演员，成为获得两次国际A类电影节最佳女演员的华人演员，[8]该片亦获圣塞巴斯蒂安国际电影节最佳影片金贝壳奖。[9]2017年登上美国《时代周刊》封面并上榜影响世界的100人， 担任第70届戛纳国际电影节评委。 同年凭借《我不是潘金莲》获得第31届中国电影金鸡奖最佳女主角、[10] 第11届亚洲电影大奖最佳女主角 及第8届中国电影导演协会年度女演员。\n2018年10月，范冰冰因涉税问题，处罚款8.84亿元，并刊登致歉信。[11]2020年1月，因武汉疫情，向武汉慈善总会捐款50万元。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/0436469ee7d010213933bec5d2c95f78.png','',1),(1104,486,'%u767D%u51B0','白冰（Michelle），原名陈东，1986年5月2日出生于陕西省西安市，中国内地女演员，毕业于西北政法大学。\n2006年，白冰因参加央视《梦想中国》后签约香港英皇娱乐旗下的英皇星艺公司，从而踏入了演艺圈。2007年，白冰在爱情电影《爱情呼叫转移》中崭露头角 [1]。2010年，白冰凭借古装爱情剧《神话》人气上升，受到观众关注[2]；同年，主演爱情剧《苦咖啡》[3][4]。\n2011年，主演宫廷历史剧《凰图腾》。3月，凭借都市爱情电影《隐婚男女》获得了第5届华鼎奖华语年度电影新锐演员奖[5]。2013年，主演古装电视剧《画皮之真爱无悔》[6]，同年参演古装电视剧《隋唐演义》[7]。2016年，特别出演古装玄幻剧《幻城》[8]。\n2020年，白冰作为选手参加了女团选拔节目《乘风破浪的姐姐》','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/51232f72c17bebdb9acec560daa01518.png','',0),(1105,487,'%u5154%u5154','刘亦菲，1987年8月25日出生于湖北省武汉市，华语影视女演员、歌手，毕业于北京电影学院2002级表演系本科。\n\n2002年，因出演电视剧《金粉世家》中白秀珠一角踏入演艺圈[1]。2003年因主演武侠剧《天龙八部》崭露头角[2]。2004年凭借仙侠剧《仙剑奇侠传》赵灵儿一角获得了高人气与关注度[3]。2005年因在武侠剧《神雕侠侣》中饰演小龙女受到广泛关注[4][5]。2006年发行首张国语专辑《刘亦菲》和日语专辑《All My Words》[6][7]；同年，成为金鹰节历史上首位金鹰女神[8]。2008年起转战大银幕，并凭借好莱坞电影《功夫之王》成为首位荣登IMDB电影新人排行榜榜首的亚洲女星[9]。2009年在“80后新生代娱乐大明星”评选活动中获封“四小花旦”之一[10]。2012年，获得第24届香港专业电影摄影师学会最具魅力女演员奖[11]。\n\n2014年，凭借出演古装片《铜雀台》中灵雎一角获得第5届澳门国际电影节最佳女主角奖[12]。2015年，刘亦菲主演的电影《夜孔雀》、《烽火芳菲》均入围国际A类电影节主竞赛单元[13][14]。2016年，凭借出演爱情片《第三种爱情》中邹雨一角获得第16届华语电影传媒大奖最受瞩目女演员奖[15]。2017年，主演迪士尼真人版电影《花木兰》[16]，并入选《好莱坞报道者》评选的“好莱坞新星”[17]；同年，凭借奇幻片《二代妖精之今生有幸》中白纤楚一角获得颇高关注[18]。2018年，主演电视剧《南烟斋笔录》饰演陆曼笙和夜摩罗。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/67049eb2802a4995973ac43655162bb9.png','',1),(1106,487,'%u571F','刘亦菲，1987年8月25日出生于湖北省武汉市，华语影视女演员、歌手，毕业于北京电影学院2002级表演系本科。\n\n2002年，因出演电视剧《金粉世家》中白秀珠一角踏入演艺圈[1]。2003年因主演武侠剧《天龙八部》崭露头角[2]。2004年凭借仙侠剧《仙剑奇侠传》赵灵儿一角获得了高人气与关注度[3]。2005年因在武侠剧《神雕侠侣》中饰演小龙女受到广泛关注[4][5]。2006年发行首张国语专辑《刘亦菲》和日语专辑《All My Words》[6][7]；同年，成为金鹰节历史上首位金鹰女神[8]。2008年起转战大银幕，并凭借好莱坞电影《功夫之王》成为首位荣登IMDB电影新人排行榜榜首的亚洲女星[9]。2009年在“80后新生代娱乐大明星”评选活动中获封“四小花旦”之一[10]。2012年，获得第24届香港专业电影摄影师学会最具魅力女演员奖[11]。\n\n2014年，凭借出演古装片《铜雀台》中灵雎一角获得第5届澳门国际电影节最佳女主角奖[12]。2015年，刘亦菲主演的电影《夜孔雀》、《烽火芳菲》均入围国际A类电影节主竞赛单元[13][14]。2016年，凭借出演爱情片《第三种爱情》中邹雨一角获得第16届华语电影传媒大奖最受瞩目女演员奖[15]。2017年，主演迪士尼真人版电影《花木兰》[16]，并入选《好莱坞报道者》评选的“好莱坞新星”[17]；同年，凭借奇幻片《二代妖精之今生有幸》中白纤楚一角获得颇高关注[18]。2018年，主演电视剧《南烟斋笔录》饰演陆曼笙和夜摩罗。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/b9ff359a83e7422f283d71dcce838007.png','',0),(1107,487,'%u5154%u5154','刘亦菲，1987年8月25日出生于湖北省武汉市，华语影视女演员、歌手，毕业于北京电影学院2002级表演系本科。\n\n2002年，因出演电视剧《金粉世家》中白秀珠一角踏入演艺圈[1]。2003年因主演武侠剧《天龙八部》崭露头角[2]。2004年凭借仙侠剧《仙剑奇侠传》赵灵儿一角获得了高人气与关注度[3]。2005年因在武侠剧《神雕侠侣》中饰演小龙女受到广泛关注[4][5]。2006年发行首张国语专辑《刘亦菲》和日语专辑《All My Words》[6][7]；同年，成为金鹰节历史上首位金鹰女神[8]。2008年起转战大银幕，并凭借好莱坞电影《功夫之王》成为首位荣登IMDB电影新人排行榜榜首的亚洲女星[9]。2009年在“80后新生代娱乐大明星”评选活动中获封“四小花旦”之一[10]。2012年，获得第24届香港专业电影摄影师学会最具魅力女演员奖[11]。\n\n2014年，凭借出演