0),(1111,489,'vhvyvy','刘亦菲，1987年8月25日出生于湖北省武汉市，华语影视女演员、歌手，毕业于北京电影学院2002级表演系本科。\n\n2002年，因出演电视剧《金粉世家》中白秀珠一角踏入演艺圈[1]。2003年因主演武侠剧《天龙八部》崭露头角[2]。2004年凭借仙侠剧《仙剑奇侠传》赵灵儿一角获得了高人气与关注度[3]。2005年因在武侠剧《神雕侠侣》中饰演小龙女受到广泛关注[4][5]。2006年发行首张国语专辑《刘亦菲》和日语专辑《All My Words》[6][7]；同年，成为金鹰节历史上首位金鹰女神[8]。2008年起转战大银幕，并凭借好莱坞电影《功夫之王》成为首位荣登IMDB电影新人排行榜榜首的亚洲女星[9]。2009年在“80后新生代娱乐大明星”评选活动中获封“四小花旦”之一[10]。2012年，获得第24届香港专业电影摄影师学会最具魅力女演员奖[11]。\n\n2014年，凭借出演古装片《铜雀台》中灵雎一角获得第5届澳门国际电影节最佳女主角奖[12]。2015年，刘亦菲主演的电影《夜孔雀》、《烽火芳菲》均入围国际A类电影节主竞赛单元[13][14]。2016年，凭借出演爱情片《第三种爱情》中邹雨一角获得第16届华语电影传媒大奖最受瞩目女演员奖[15]。2017年，主演迪士尼真人版电影《花木兰》[16]，并入选《好莱坞报道者》评选的“好莱坞新星”[17]；同年，凭借奇幻片《二代妖精之今生有幸》中白纤楚一角获得颇高关注[18]。2018年，主演电视剧《南烟斋笔录》饰演陆曼笙和夜摩罗。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/b90cbb61800f7d9896075b8316e07fba.png','',12),(1112,490,'%u9752%u6D77%u6E56','青海湖，藏语名为“措温布”（意为“青色的海”）。位于青藏高原东北部、青海省境内，中国最大的内陆湖。由祁连山脉的大通山、日月山与青海南山之间的断层陷落形成。[1]\n\n2012年7月30日，青海省气象科学研究所最新的遥感监测结果显示，青海湖面积持续8年增大。\n\n2014年10月20日9时50分，青海湖海心山北侧出现“龙吸水”壮观场景。[2]','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/c748468bd8f62cde44affb4128c14c30.png','',0),(1113,490,'%u7A3B%u57CE%u4E9A%u4E01','\n \n\n目录\n \n四川亚丁国家级自然保护区\n    \n同义词\n稻城亚丁一般指四川亚丁国家级自然保护区\n多义项\n省级风景名胜区 更多义项 \n特色词条 | 本词条按照特色词条指南编辑并维护\n贡献维护者 mockJkore \n四川亚丁国家级自然保护区，位于四川省甘孜藏族自治州南部稻城县香格里拉镇，地处青藏高原东部，横断山脉中段，南部与云南省香格里拉毗邻，东南连泸沽湖和丽江。地理坐标为东经99度58分-100度28分，北纬28度11分-28度34分，总面积1457.5平方千米，截至2016年10月已开发面积为32.44平方千米[1][2][3][4]。\n\n四川亚丁国家级自然保护区森林面积560平方千米，有维管束植物1126种、脊椎动物291种。海拔在5000米以上的山峰10余座，海拔4500米以上的山峰30余座，高山古冰川湖泊62个[4]。\n\n2001年6月，成为国家级自然保护区[5]；2003年7月10日，被列入联合国MAB保护计划[5]。\n\n因疫情原因，景区预计2020年3月10日重新开放。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/60d87f4301931474e90f4da4f01cef5c.png','',0),(1114,490,'%u5929%u4E0A%u4EBA%u95F4','\n \n\n目录\n \n天上人间\n北京夜总会名\n本词条是多义词，共25个义项\n展开\n北京“天上人间”夜总会的全称是：北京长青泰餐饮娱乐有限公司“天上人间”夜总会，位于北京朝阳区东三环北京长城饭店西侧副楼，北临亮马河及燕莎购物中心，西临昆仑饭店、南临农业展览馆，是京城繁华高消费的金三角地区。2010年5月11日，因被查获有偿陪侍小姐，被勒令停业整顿6个月。其法人代表林美峰，外资企业，最大股东是为覃姓美籍华人（约占总股份的51%）。天上人间内消费昂贵，服务设施豪华，更重要吸引人的地方是据称有众多的绝色美女服务生，这里一般是名流富豪聚集的场所天上人间之所以被炒作的如此神话主要是因为能在这里消费起的个人还是很少的，大多数是公司性的消费（也就是烧钱的地方）。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/57c0e9207ef9abc2ef9c527e6cc7336d.png','',0),(1115,490,'%u660E%u5341%u4E09%u9675','明十三陵，世界文化遗产，全国重点文物保护单位，国家重点风景名胜区，国家AAAAA级旅游景区。\n\n明十三陵坐落于北京市昌平区天寿山麓，总面积一百二十余平方公里，距离天安门约五十公里。十三陵地处东、西、北三面环山的小盆地之中，陵区周围群山环抱，中部为平原，陵前有小河曲折蜿蜒。自永乐七年（1409）五月始作长陵，到明朝最后一帝崇祯葬入思陵止，其间230多年，先后修建了十三座皇帝陵墓、七座妃子墓、一座太监墓。共埋葬了十三位皇帝、二十三位皇后、二位太子、三十余名妃嫔、两位太监。截止2011年，已开放景点有长陵、定陵、昭陵、神路。[1]\n\n2015年10月，国家旅游局通过暗访检查，发现明十三陵景区的主要存在外围欺客宰客现象严重，无明码标价；卫生情况差，景区垃圾裸露多，地面污物清扫不及时；游览设施不足，游客中心功能不全等问题，对景区给予严重警告，并公开通报，给予6个月时间整改。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/dd5cba22190ccec459802086cc50cc9c.png','',0),(1116,491,'%u5F00%u519B%u8230','记录贴','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/a564c959029cac9a68e4e448c7bda6a9.png','',0),(1117,491,'%u8C08%u8A00%u5FAE%u4E2D','哦玉兔','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/6bdc29587790d6f22d7853891caa0989.png','',0),(1118,492,'bxbhx','ycyxyxggch','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/62903933a270095b7c1b86b1d15b7bf0.png','',0),(1119,492,'cvv',' cccc','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/0b1f904349250a269dc4909f937c7bea.png','',0),(1120,493,'%u5566%u5566%u5566%u5566','突突突找我额','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/ecfe3ae2d5c2ec364103122851b29d91.png','',2),(1121,493,'%u7A81%u7A81%u5154','下雨天','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/08116f31a6dacd6438c77fbb0a25f393.png','',1),(1122,494,'%u563B%u563B%u563B','啊嘟嘟诺','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/74394e25a9fa7164d16025ca361a46bc.png','',0),(1123,494,'%u56FE','凸透镜','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/4d4869f7113defcbbd54eea379593a13.png','',0),(1124,495,'%u563B%u563B%u563B','啊嘟嘟诺','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/74394e25a9fa7164d16025ca361a46bc.png','',0),(1125,495,'%u56FE','凸透镜','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/4d4869f7113defcbbd54eea379593a13.png','',1),(1126,496,'vvv','cncnng','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/629a03a0fa60eb863976b35681e8a542.png','',1),(1127,496,'%u4F60%u90A3%u8FB9','哥哥vv不','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/b3fe593cd90b876d799b2700884ed141.png','',1),(1128,497,'BMW','宝马汽车，是指宝马汽车公司(Bayerische Motoren Werke AG，简称BMW)生产的汽车，主要的系列车型有1、2、3、4、5、6、7、8等系列。以生产豪华轿车、摩托车和高性能发动机而闻名于世。\n\n宝马汽车公司是世界著名的轿车公司，它和奔驰汽车公司一样，不追求汽车产量的扩大，只追求生产高品质、高性能和高级别的汽车。\"坐奔驰，开宝马\"的说法，表明了奔驰的稳重和宝马的豪放。只有开宝马车，才能享受到它那痛快淋漓的神奇风采。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/c005be80dafa1d9892ea1c905b20c99e.png','',0),(1129,497,'%u5954%u9A70','梅赛德斯-奔驰（Mercedes-Benz）是世界知名的德国汽车品牌，创立于1900年，总部设在斯图加特，创建人为卡尔·本茨（Karl Benz）和戈特利布·戴姆勒（Gottlieb Daimler）。梅赛德斯-奔驰以高质量、高性能的汽车产品闻名于世，除了高档豪华轿车外，奔驰公司还是世界上最著名的大客车和重型载重汽车的生产厂家。目前，梅赛德斯-奔驰为戴姆勒（Daimler AG）旗下的一个部门。\n\n2015年4月23日，江苏省物价局对奔驰公司罚款3.5亿元，对部分经销商罚款786.9万元。奔驰成为中国汽车反垄断处罚史上单品牌最高罚单。 2016年10月，奔驰是2016年全球100大最有价值品牌第9名。2019年10月，Interbrand发布的全球品牌百强排名第八位。 ','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/c66e7c4505680dcdc851dd4450ececec.png','',0),(1130,497,'%u5965%u8FEA','奥迪是一个国际高品质汽车研发商和制造商。现为大众汽车公司的子公司，总部设在德国的英戈尔施塔特，奥迪主要量产车系有A系列（涵盖AO级别、A级别、B级别、C级别、D级别车型）、Q系列、R系列、TT系列、S系列、RS系列及尤A系列繁衍出的Allroad系列。\n\n由于2015年的“尾气门”测试造假，2018年6月13日，德国下萨克森州布伦瑞克对大众公司开出10亿欧元罚单，6月18日，德国警方又逮捕了奥迪首席执行官史塔德。2018年6月14日，奥迪股份有限公司作为新增股东加入上汽集团。2018年6月26日，获得德国大众集团持有的上汽大众股份中的1%股份。2018年10月11日，奥迪与华为联合宣布，在L4自动驾驶领域进行联合创新。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/3f1a642b0cb39837947e9e57fe950994.png','',0),(1131,497,'%u5927%u4F17','大众汽车（德语：Volkswagen）是一家总部位于德国沃尔夫斯堡的汽车制造公司，也是世界四大汽车生产商之一的大众集团的核心企业。\n\nVolks在德语中意思为“国民”，Wagen在德语中意思为“汽车”，全名的意思即“国民的汽车”，故又常简称为“VW”。台湾译为福斯汽车，港澳、大陆译为大众汽车或福士汽车，意思是“人民的汽车”。整个汽车集团在2012年产销超过907万辆，大众品牌则超过574万辆。\n\n2018年8月25日，大众官方宣布独立推出电动“We Share”汽车共享服务。11月，大众宣布进军电动汽车领域。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/8cc3d3161c7a9cbccc7cfa422cd400f6.png','',0),(1132,498,'BMW','宝马汽车，是指宝马汽车公司(Bayerische Motoren Werke AG，简称BMW)生产的汽车，主要的系列车型有1、2、3、4、5、6、7、8等系列。以生产豪华轿车、摩托车和高性能发动机而闻名于世。\n\n宝马汽车公司是世界著名的轿车公司，它和奔驰汽车公司一样，不追求汽车产量的扩大，只追求生产高品质、高性能和高级别的汽车。\"坐奔驰，开宝马\"的说法，表明了奔驰的稳重和宝马的豪放。只有开宝马车，才能享受到它那痛快淋漓的神奇风采。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/c005be80dafa1d9892ea1c905b20c99e.png','',0),(1133,498,'%u5954%u9A70','梅赛德斯-奔驰（Mercedes-Benz）是世界知名的德国汽车品牌，创立于1900年，总部设在斯图加特，创建人为卡尔·本茨（Karl Benz）和戈特利布·戴姆勒（Gottlieb Daimler）。梅赛德斯-奔驰以高质量、高性能的汽车产品闻名于世，除了高档豪华轿车外，奔驰公司还是世界上最著名的大客车和重型载重汽车的生产厂家。目前，梅赛德斯-奔驰为戴姆勒（Daimler AG）旗下的一个部门。\n\n2015年4月23日，江苏省物价局对奔驰公司罚款3.5亿元，对部分经销商罚款786.9万元。奔驰成为中国汽车反垄断处罚史上单品牌最高罚单。 2016年10月，奔驰是2016年全球100大最有价值品牌第9名。2019年10月，Interbrand发布的全球品牌百强排名第八位。 ','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/c66e7c4505680dcdc851dd4450ececec.png','',0),(1134,498,'%u5965%u8FEA','奥迪是一个国际高品质汽车研发商和制造商。现为大众汽车公司的子公司，总部设在德国的英戈尔施塔特，奥迪主要量产车系有A系列（涵盖AO级别、A级别、B级别、C级别、D级别车型）、Q系列、R系列、TT系列、S系列、RS系列及尤A系列繁衍出的Allroad系列。\n\n由于2015年的“尾气门”测试造假，2018年6月13日，德国下萨克森州布伦瑞克对大众公司开出10亿欧元罚单，6月18日，德国警方又逮捕了奥迪首席执行官史塔德。2018年6月14日，奥迪股份有限公司作为新增股东加入上汽集团。2018年6月26日，获得德国大众集团持有的上汽大众股份中的1%股份。2018年10月11日，奥迪与华为联合宣布，在L4自动驾驶领域进行联合创新。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/3f1a642b0cb39837947e9e57fe950994.png','',0),(1135,498,'%u5927%u4F17','大众汽车（德语：Volkswagen）是一家总部位于德国沃尔夫斯堡的汽车制造公司，也是世界四大汽车生产商之一的大众集团的核心企业。\n\nVolks在德语中意思为“国民”，Wagen在德语中意思为“汽车”，全名的意思即“国民的汽车”，故又常简称为“VW”。台湾译为福斯汽车，港澳、大陆译为大众汽车或福士汽车，意思是“人民的汽车”。整个汽车集团在2012年产销超过907万辆，大众品牌则超过574万辆。\n\n2018年8月25日，大众官方宣布独立推出电动“We Share”汽车共享服务。11月，大众宣布进军电动汽车领域。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/8cc3d3161c7a9cbccc7cfa422cd400f6.png','',0),(1136,499,'%u5177%u4F53','吐口','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/b38e95bbc1eeed61dad51e55380ab661.png','',0),(1137,499,'%u6D82%u6D82','看监控','http://chengxin