-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/7fe3eda59a9808fab7a2efae23d487ba.png','',0),(1151,505,'%u5927%u4F17','大众汽车（德语：Volkswagen）是一家总部位于德国沃尔夫斯堡的汽车制造公司，也是世界四大汽车生产商之一的大众集团的核心企业。\n\nVolks在德语中意思为“国民”，Wagen在德语中意思为“汽车”，全名的意思即“国民的汽车”，故又常简称为“VW”。台湾译为福斯汽车，港澳、大陆译为大众汽车或福士汽车，意思是“人民的汽车”。整个汽车集团在2012年产销超过907万辆，大众品牌则超过574万辆。\n\n2018年8月25日，大众官方宣布独立推出电动“We Share”汽车共享服务。11月，大众宣布进军电动汽车领域。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/603e7ac857e6af2a61f1422acec2152b.png','',0),(1152,505,'%u5965%u8FEA','奥迪是一个国际高品质汽车研发商和制造商。现为大众汽车公司的子公司，总部设在德国的英戈尔施塔特，奥迪主要量产车系有A系列（涵盖AO级别、A级别、B级别、C级别、D级别车型）、Q系列、R系列、TT系列、S系列、RS系列及尤A系列繁衍出的Allroad系列。\n\n由于2015年的“尾气门”测试造假，2018年6月13日，德国下萨克森州布伦瑞克对大众公司开出10亿欧元罚单，6月18日，德国警方又逮捕了奥迪首席执行官史塔德。2018年6月14日，奥迪股份有限公司作为新增股东加入上汽集团。2018年6月26日，获得德国大众集团持有的上汽大众股份中的1%股份。2018年10月11日，奥迪与华为联合宣布，在L4自动驾驶领域进行联合创新。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/01948a12d37381915c84c000a9b892f9.png','',5),(1153,505,'%u5954%u9A70','梅赛德斯-奔驰（Mercedes-Benz）是世界知名的德国汽车品牌，创立于1900年，总部设在斯图加特，创建人为卡尔·本茨（Karl Benz）和戈特利布·戴姆勒（Gottlieb Daimler）。梅赛德斯-奔驰以高质量、高性能的汽车产品闻名于世，除了高档豪华轿车外，奔驰公司还是世界上最著名的大客车和重型载重汽车的生产厂家。目前，梅赛德斯-奔驰为戴姆勒（Daimler AG）旗下的一个部门。\n\n2015年4月23日，江苏省物价局对奔驰公司罚款3.5亿元，对部分经销商罚款786.9万元。奔驰成为中国汽车反垄断处罚史上单品牌最高罚单。 2016年10月，奔驰是2016年全球100大最有价值品牌第9名。2019年10月，Interbrand发布的全球品牌百强排名第八位。 ','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/a9c5d2e0f4fb828398c55bef0dfab7cd.png','',0),(1154,505,'%u5B9D%u9A6C','宝马汽车，是指宝马汽车公司(Bayerische Motoren Werke AG，简称BMW)生产的汽车，主要的系列车型有1、2、3、4、5、6、7、8等系列。以生产豪华轿车、摩托车和高性能发动机而闻名于世。\n\n宝马汽车公司是世界著名的轿车公司，它和奔驰汽车公司一样，不追求汽车产量的扩大，只追求生产高品质、高性能和高级别的汽车。\"坐奔驰，开宝马\"的说法，表明了奔驰的稳重和宝马的豪放。只有开宝马车，才能享受到它那痛快淋漓的神奇风采。','http://chengxin-public.oss-cn-shanghai.aliyuncs.com/chengxin_rz/c354548089432e6272a86e20ec012eda.png','',0),(1155,506,'%u5927%u4F17','大众汽车（德语：Volkswagen）是一家总部位于德国沃尔夫斯堡的汽车制造公司，也是世界四大汽车生产商之一的大众集团的核心企业。\n\nVolks在德语中意思为“国民”，Wagen在德语中意思为“汽车”，全名的意思即“国民的汽车”，故又常简称为“VW”。台湾译为福斯汽车，港澳、大陆译为大众汽车或福士汽车，意思是“人民的汽车”。整个汽车集团在2012年产销超过907万辆，大众品牌则超过